sys_variable_value.value:
(function execute(inputs, outputs) {
	//To create an Array from the given comma seperated string
    var cs = (inputs.comma_string).toString().trim();
    var csArray = cs.split(",");
    var outputArray = [];
    for (var i = 0; i < csArray.length; i++) {
        outputArray.push((csArray[i]).toString().trim());
    }
    outputs.converted_array = outputArray;
})(inputs, outputs);

